package com.dotcom.jamaatAdmin.model;/** * Created by anjanik on 14/4/16. * Model for Expandable List Child */public class Child {    private String Name;    private int Image;    private int Count;    public int getCount() {        return Count;    }    public void setCount(int count) {        this.Count = count;    }    public String getName() {        return Name;    }    public void setName(String Name) {        this.Name = Name;    }    public int getImage() {        return Image;    }    public void setImage(int Image) {        this.Image = Image;    }}